import React, { useState } from 'react';


import { Avatar, Button, Box, grommet, Grommet, Nav, Sidebar ,Text} from 'grommet';

import {
  Analytics,
  Chat,
  Clock,
  Configure,
  Help,
  Projects,
  StatusInfoSmall,
  UserAdmin,
  CircleInformation,
} from 'grommet-icons';
import { Tip } from 'grommet/components/Tip';
let role=localStorage.getItem('role');
const SidebarHeader = () => (
  <Avatar
    border={{ size: 'small', color: 'accent-2' }}
    background="white"
    flex={false}
  >
    
    <Tip
          plain
          dropProps={{ align: { left: 'right' } }}
          content={
            <Box align="start" margin={{ bottom: 'xlarge' }} pad="xsmall">
              <Circle margin={{ left: 'large' }} pad="small">
                <Info color="accent-1" />
              </Circle>
              <Circle margin={{ left: 'medium' }} pad="small" />
              <Circle pad="xsmall" />
            </Box>
          }
        >
          <Button icon={<UserFemale color="accent-1" size="large" />} />
        </Tip>
    
  </Avatar>
);

// const SidebarFooter = () => (
//   <Nav gap="small">
//     <Button icon={<Chat />} />
//     <Button icon={<Help />} />
//   </Nav>
// );

const MainNavigation = () => (
  <Nav gap="small">
    <Button icon={<StatusInfoSmall />} />
    <Button icon={<Projects />} />
    <Button icon={<Clock />} />
    <Box pad="small" border={{ color: 'white', side: 'bottom' }} />
    <Box gap="small" pad={{ vertical: 'medium' }}>
      <Button icon={<Analytics />} />
      <Button icon={<Configure />} />
    </Box>
  </Nav>
);


export const adminHome = () => {
  return(
    <Box direction="row" height={{ min: '100%' }}>
    <Sidebar
      background="accent-1"
      header={<SidebarHeader />}
    //   footer={<SidebarFooter />}
    >
      <MainNavigation />
    </Sidebar>
  </Box>
  )
};
